class Solution(object):
    def maxNumberOfAlloys(self, n, k, budget, composition, stock, cost):
        def can_produce(machine, alloys):
            total_cost = 0
            for metal in range(n):
                required = alloys * composition[machine][metal]
                need_to_buy = max(0, required - stock[metal])
                total_cost += need_to_buy * cost[metal]
            return total_cost <= budget

        max_alloys = 0
        for machine in range(k):
            low, high = 0, budget
            while low <= high:
                mid = (low + high) // 2
                if can_produce(machine, mid):
                    max_alloys = max(max_alloys, mid)
                    low = mid + 1
                else:
                    high = mid - 1
        return max_alloys
